('node', 'page', 0, 55, 55, 'und', 0, '	<section class="row bigtoppadding">\r\n	<h5 class="text-color light midbottommargin">4 THREE COLUMNS.</h5>\r\n	<!-- 4 THREE COLUMNS -->\r\n	<p class="three columns alpha">\r\n		 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints.\r\n	</p>\r\n	<p class="three columns">\r\n		 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints.\r\n	</p>\r\n	<p class="three columns">\r\n		 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints.\r\n	</p>\r\n	<p class="three columns">\r\n		 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints.\r\n	</p>\r\n	</section>\r\n	<section class="row bigpadding">\r\n	<h5 class="text-color light midbottommargin">3 FOUR COLUMNS.</h5>\r\n	<!-- THREE FOUR COLUMNS -->\r\n	<p class="four columns alpha">\r\n		 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints. We spend more, but have less, we buy more, but enjoy less.\r\n	</p>\r\n	<p class="four columns">\r\n		 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints. We spend more, but have less, we buy more, but enjoy less.\r\n	</p>\r\n	<p class="four columns">\r\n		 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints. We spend more, but have less, we buy more, but enjoy less.\r\n	</p>\r\n	</section>\r\n	<section class="row">\r\n	<h5 class="text-color light midbottommargin">2 SIX COLUMNS.</h5>\r\n	<!-- 2 SIX COLUMNS -->\r\n	<p class="six columns alpha">\r\n		 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints. We spend more, but have less, we buy more, but enjoy less.\r\n	</p>\r\n	<p class="six columns">\r\n		 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints. We spend more, but have less, we buy more, but enjoy less.\r\n	</p>\r\n	</section>\r\n	<section class="row bigpadding">\r\n	<!-- TWELVE COLUMNS -->\r\n	<h5 class="text-color light midbottommargin">TWELVE COLUMNS.</h5>\r\n	<p class="twelve columns alpha">\r\n		 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints. We spend more, but have less, we buy more, but enjoy less. We have bigger houses and smaller families, more conveniences, but less time. We have more degrees but less sense, more knowledge, but less judgment, more experts, yet more problems, more medicine, but less wellness.\r\n	</p>\r\n	</section>\r\n	<section class="row">\r\n	<!-- EIGHT COLUMNS CENTERED -->\r\n	<h5 class="text-color light midbottommargin center">EIGHT COLUMNS CENTERED.</h5>\r\n	<p class="eight columns alpha centered center">\r\n		 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints. We spend more, but have less, we buy more, but enjoy less. We have bigger houses and smaller families, more conveniences, but less time. We have more degrees but less sense, more knowledge, but less judgment, more experts, yet more problems, more medicine, but less wellness.\r\n	</p>\r\n	</section>\r\n	<section class="row bigpadding">\r\n	<!-- FOUR AND EIGHT COLUMNS -->\r\n	<h5 class="text-color light midbottommargin">FOUR COLUMNS &amp; EIGHT COLUMNS.</h5>\r\n	<p class="four columns alpha">\r\n		 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints.\r\n	</p>\r\n	<p class="eight columns">\r\n		 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints. We spend more, but have less, we buy more, but enjoy less. We have bigger houses and smaller families, more conveniences, but less time.\r\n	</p>\r\n	</section>\r\n	<section class="row">\r\n	<!-- EIGHT AND FOUR COLUMNS -->\r\n	<h5 class="text-color light midbottommargin">EIGHT COLUMNS &amp; FOUR COLUMNS.</h5>\r\n	<p class="eight columns alpha">\r\n		 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints. We spend more, but have less, we buy more, but enjoy less. We have bigger houses and smaller families, more conveniences, but less time.\r\n	</p>\r\n	<p class="four columns">\r\n		 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints.\r\n	</p>\r\n	</section>\r\n	<section class="row bigpadding">\r\n	<div class="six columns">\r\n		<h5 class="text-color light midbottommargin">THIS IS DROPCAPS.</h5>\r\n		\r\n		<!-- DROPCAP -->\r\n		<p class="dropcaps">\r\n			 These are the times of fast foods and slow digestion, bigmen and small character, steep profits and shallow relationships. These are the days of two incomes but more divorce, fancier houses, but broken homes. These are days of quick trips, disposable diapers,throw away morality, one night stands, overweight bodies, and pills that do everything from cheer, to quiet, to kill.\r\n		</p>\r\n		\r\n	</div>\r\n	<div class="five columns push_one">\r\n		<h5 class="text-color light midbottommargin">THIS IS BLOCKQUOTE.</h5>\r\n		\r\n		<!-- BLOCKQUOTE -->\r\n		<blockquote>\r\n			 The paradox of our time in history is that we have taller buildings but shorter tempers, wider Freeways, but narrower viewpoints. We spend more, but have less, we buy more, but enjoy less.\r\n		</blockquote>\r\n	</div>\r\n	</section>\r\n	<section class="row">\r\n	<h5 class="text-color light m